import React from 'react';
import './Navbar.css'; // Make sure this path matches your setup

const Navbar = () => {
  return (
    <div className="navbar">
      <div className="navbar-container">
        <a href="/" className="navbar-logo">Expense Tracker</a>
        <div className="navbar-links">
          <a href="/" className="navbar-link">Home</a>
          <a href="/login" className="navbar-link">Login/Register</a>
          <a href="/about" className="navbar-link">About</a>
          {/* <a href="/register" className="navbar-link">Register</a> */}
        </div>
      </div>
    </div>
  );
};

export default Navbar;
